import {useGetLaunchesQuery} from "./api/spaceXApi";
import {SpaceXShips} from "./SpaceXShips";

export const SpaceXLaunches = ({sortArg,}) => {
    const {data, isLoading, error} = useGetLaunchesQuery(sortArg);
    console.log(data)
    if(data){
        data.docs.map((launch, index) => {
            console.log(launch.date_local);
        })
    }

    //<!-- <SpaceXShips shipsID={launch.ships[0]}/> -->
    return (
        <>{error ? (
            <>Oh no, there was an error</>
        ) : isLoading ? (
            <>Loading...</>
        ) : data ? (
            <>
                <ul>
                    {data.docs.map((launch, index) => (
                        <li key={index}><h1>
                            {launch.name}
                        </h1>
                            <p>
                                Data: {launch.date_local.getFullYear()}
                            </p>
                            <p>
                                {launch.details}
                            </p>
                            <img src={launch.links.flickr.original[0]} alt={''} width={250}/>
                        </li>
                    ))}
                </ul>
            </>
        ) : null}
        </>
    );
}
